export const TodoList = ({ list, handleToggle }) =>{
    return(
        <div>
            {list.map((e) =>(
                // <p>
                //     {e.title} - {e.status ? "Done" : "Not Done"}
                // </p>
                <p key={e.id}>
                    {e.title} - {e.status ? "Done" : "Not Done"}


                    <button
                onClick={() => {
                    handleToggle(e.id, e.title)
                }}
                >

                </button>

                </p>

            ))}
        </div>
    );
};

